import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import Sidebar from "../components/Sidebar";
import Topbar from "../components/Topbar";
import ClauseCard from "../components/ClauseCard";
import InsightCard from "../components/InsightCard";
import EvidenceDrawer from "../components/EvidenceDrawer";
import BackButton from "../components/BackButton";

const ContractDetail = () => {
  const { id } = useParams();
  const [contract, setContract] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(false);
  const [evidenceOpen, setEvidenceOpen] = useState(false);

  useEffect(() => {
    fetch("/contracts.json") // For demo, fetch all and find by ID
      .then((res) => res.json())
      .then((data) => {
        const c = data.find((c) => c.id === id);
        if (!c) throw new Error("Contract not found");
        // Mock detailed data for demonstration
        setContract({
          ...c,
          start: "2023-01-01",
          expiry: c.expiry,
          clauses: [
            { title: "Termination", summary: "90 days notice period.", confidence: 0.82 },
            { title: "Liability Cap", summary: "12 months’ fees limit.", confidence: 0.87 },
          ],
          insights: [
            { risk: "High", message: "Liability cap excludes data breach costs." },
            { risk: "Medium", message: "Renewal auto-renews unless cancelled 60 days before expiry." },
          ],
          evidence: [
            { source: "Section 12.2", snippet: "Total liability limited to 12 months’ fees.", relevance: 0.91 },
          ],
        });
        setLoading(false);
      })
      .catch(() => {
        setError(true);
        setLoading(false);
      });
  }, [id]);

  if (loading) return <p className="p-6 text-indigo-500">Loading contract...</p>;
  if (error || !contract) return <p className="p-6 text-red-500">Failed to load contract.</p>;

  return (
    <div className="flex h-screen bg-gray-50">
      <Sidebar />
      <div className="flex-1 flex flex-col">
        <Topbar />
        <div className="p-6 overflow-auto flex-1">
          <BackButton />

          {/* Metadata */}
          <div className="bg-white p-6 rounded-lg shadow mb-6">
            <h2 className="text-2xl font-bold text-indigo-600">{contract.name}</h2>
            <p className="text-gray-700">Parties: {contract.parties}</p>
            <p className="text-gray-700">Start: {contract.start}</p>
            <p className="text-gray-700">Expiry: {contract.expiry}</p>
            <p className="text-gray-700">Status: {contract.status}</p>
            <p className="text-gray-700">Risk: {contract.risk}</p>
          </div>

          {/* Clauses */}
          <h3 className="text-xl font-semibold text-indigo-600 mb-2">Clauses</h3>
          <div className="grid md:grid-cols-2 gap-4 mb-6">
            {contract.clauses.map((cl, idx) => (
              <ClauseCard key={idx} {...cl} />
            ))}
          </div>

          {/* AI Insights */}
          <h3 className="text-xl font-semibold text-indigo-600 mb-2">AI Insights</h3>
          <div className="mb-6">
            {contract.insights.map((ins, idx) => (
              <InsightCard key={idx} {...ins} />
            ))}
          </div>

          <button
            onClick={() => setEvidenceOpen(true)}
            className="px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700 transition"
          >
            View Evidence
          </button>
        </div>
      </div>

      <EvidenceDrawer
        open={evidenceOpen}
        close={() => setEvidenceOpen(false)}
        evidence={contract.evidence}
      />
    </div>
  );
};

export default ContractDetail;
